import React, { Component } from 'react';
import {Navbar, NavDropdown, Form, Button, FormControl} from 'react-bootstrap';

class Footer extends Component {
	render() {
		return (
			<div className="footer" style={{margin: '4em'}}>
				<div className="row-nm">
					<img className="footer-logo" src="images/neverland_monologo_black.png" />
					<div className="footer-nav">
						<a className="col" href="">Join the waitlist</a>
						<a className="col" href="">Our story</a>
						<a className="col" href="">Contact us</a>
					</div>
				</div>
				<div className="row-nm">
					<div className="col">
						<input className="neverland-input" placeholder="Slide into my emails!"/>
						<button style={{marginLeft: '4px'}} onClick={this.onClickWaitlist} className="neverland-button"> SIGNUP </button><br/>
					</div>
					<div> Instagram Facebook</div>
				</div>
			</div>);
	}
}

export default Footer;
